def reversCom(string):
    revString = string[::-1]
    comString = []
    for char in revString:
        if char == 'A':
            comString.append("T")
        elif char == 'T':
            comString.append("A")
        elif char == 'C':
            comString.append("G")
        else:
            comString.append("C")
    str_comString = ''.join(comString)
    return str_comString

print (reversCom(""))